            </ul>
            <ul className="right">
                <li><a href="">
                    <span className="shoppingCart"><i><FaShoppingCart size="30px"/></i><span className="cartCount">0</span>
                </span></a></li>
            </ul>
        </nav>
    )
}

export default Navbar
